  false,\n\t\"url\": null,\n\t\"notes\": \"Mapped hunt boundary is an approximation
  of regulations using best available data as of September 2015. Hunters are responsible
  for knowing the exact current boundary locations as described within the California
  Code of Regulations, Title 14, Section 485(d):(d) Crows may not be taken in the
  following areas:(1) Within the boundaries of the Trinity and Mendocino National
  Forests south of Highway 36.(2) North and east of a line beginning at the mouth
  of the Eel River; south along the Eel River to the town of Alton; east on Highway
  36 from the town of Alton to Highway 89 west of Chester; south and east on Highways
  89 and 395 to Interstate 15 near Hesperia; south on Interstate 15 to Interstate
  10; and east on Interstate 10 to the California-Arizona border.\",\n\t\"license_title\":
